import React, { Component } from 'react';
import Home from "./Home"
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <Router>
      <div className="App">
        <Home/>
      </div>
      </Router>
    );
  }
}

export default App;
